//support.zendesk.com/hc/en-us/community/posts/360003105907-Getting-started","txt.admin.conditional_fields.transition_box.title":"Conditional Ticket Fields","txt.admin.conditional_fields.transition_box.early_access":"Early access","txt.admin.conditional_fields.transition_box.learn_more":"Learn more","txt.admin.conditional_fields.transition_box.get_access_text":"We are replacing the Conditional Fields app with built-in Conditional Ticket Fields. This feature will allow you to define conditions on a ticket form to show only certain ticket fields based on agent and end-user input. Sign up for early access. If you are accepted, you will be notified via an in-product message and this page will automatically update.","txt.admin.conditional_fields.transition_box.get_access_button":"Get access","txt.admin.conditional_fields.transition_box.migration_needed_text":"Thank you for participating in this early access program, which replaces the Conditional Fields app with built-in Conditional Ticket Fields.","txt.admin.conditional_fields.transition_box.migration_needed_text_v2":"Replace the Conditional Fields app with built-in Conditional Ticket Fields.","txt.admin.conditional_fields.transition_box.migration_needed_button":"Get started","txt.admin.conditional_fields.transition_box.feedback_text":"The “conditions” link on each ticket form is where conditions are added and managed. Feedback and questions are highly encouraged. Please share in the community.","txt.admin.conditional_fields.transition_box.community_link":"Go to the community","txt.admin.conditional_fields.transition_box.community_link_url":"https://support.zendesk.com/hc/en-us/community/topics/360000025667-Zendesk-Support-EAP-Conditional-Ticket-Fields","txt.admin.conditional_fields.creating_conditions_url":"https://support.zendesk.com/hc/en-us/articles/360022293573","txt.admin.conditional_fields.migrating_conditions_url":"https://support.zendesk.com/hc/en-us/articles/360021993973","txt.admin.conditional_fields.transition_box.exit_eap_link":"Exit the early access program to restore Conditional Fields app","txt.admin.conditional_fields.migration_page.cannot_be_undone":"This cannot be undone","txt.admin.conditional_fields.migration_page.disable_cfa_warning":"Transitioning to built-in Conditional Ticket Fields permanently disables the Conditional Fields app.","txt.admin.conditional_fields.migration_page.skipping_migration_warning":"You are skipping the automatic migration and will not be able to migrate later.","txt.admin.conditional_fields.migration_page.explanation_two_ga":"After migration, check your end-user and agent ticket forms to make sure conditions are working as expected.","txt.admin.conditional_fields.migration_page.title_with_migration":"Enable Conditional Ticket Fields and migrate conditions","txt.admin.conditional_fields.migration_page.title_without_migration":"Enable Conditional Ticket Fields without migration","txt.admin.conditional_fields.migration_page.explanation_one":"Before you proceed, make sure that the conditions in your Conditional Fields app are current.","txt.admin.conditional_fields.migration_page.explanation_one_v2":"Before you proceed, make sure that the conditions in your Conditional Fields app are current. To ensure that there is no stale data in the app, navigate to the Conditional Fields app settings and click the Save button. This will automatically fix many potential migration errors.","txt.admin.conditional_fields.migration_page.effects_title":"Effects on your account","txt.admin.conditional_fields.migration_page.effect_not_migrated.title":"Conditions from the Conditional Fields app will not be migrated","txt.admin.conditional_fields.migration_page.effect_not_migrated.description":"This is because the Conditional Fields app is currently disabled. Your end-user and agent ticket forms will not have any conditions after this step. You will not be able to migrate conditions later.","txt.admin.conditional_fields.migration_page.effect_migrated.title":"The conditions from the Conditional Fields app will be migrated to built-in Conditional Ticket Fields","txt.admin.conditional_fields.migration_page.effect_migrated.description":"However, built-in Conditional Ticket Fields will not support the group field. If there are conditions that contain the group field, the migration will not work. You must delete those conditions before migrating.","txt.admin.conditional_fields.migration_page.effect_app_disabled.title":"The Conditional Fields app will be disabled","txt.admin.conditional_fields.migration_page.effect_app_disabled.description":"Using built-in Conditional Ticket Fields automatically disables the Conditional Fields app to prevent conflicts. Only one conditions system can be active at a time. Your current conditions will not be deleted.","txt.admin.conditional_fields.migration_page.effect_conditions.title":"All conditions will be managed within ticket forms","txt.admin.conditional_fields.migration_page.effect_conditions.description":"After enabling built-in Conditional Ticket Fields, conditions will be managed within their respective ticket forms.","txt.admin.conditional_fields.migration_page.explanation_two":"After migration, check your end-user and agent ticket forms to make sure conditions are working as expected. You always have the option to exit the early access program. Doing so will re-enable the Conditional Fields app and restore your former conditional fields settings. Exiting will also delete all built-in conditions created after migration.","txt.admin.conditional_fields.migration_page.cancel":"Cancel","txt.admin.conditional_fields.migration_page.proceed":"Proceed","txt.admin.conditional_fields.migration_page.in_progress":"Migration in progress. This can take up to one minute.","txt.admin.conditional_fields.migration_page.migration_error_title":"Could not migrate from the Conditional Fields app","txt.admin.conditional_fields.migration_page.error.server_error_title":"Could not enable Conditional Ticket Fie